import React from "react";
import { Footer, FooterTab, Button, Text } from "native-base";
import { Link } from "react-router-native";
import { StatusBar, StyleSheet } from "react-native";
import { useHistory } from "react-router";

export const AppFooter = () => {
  const history = useHistory();

  return (
    <Footer>
      <FooterTab>
        <Button
          onPress={() => {
            history.push("/allCities");
          }}
        >
          {/*<Link to={`/allCities`} underlayColor="#f0f4f7" style={styles.link}>*/}
          <Text>All Cities</Text>
          {/*</Link>*/}
        </Button>
        <Button>
          <Link to={`/myCity`} underlayColor="#f0f4f7" style={styles.link}>
            <Text>My City</Text>
          </Link>
        </Button>
        <Button>
          <Link to={`/starScreen`} underlayColor="#f0f4f7" style={styles.link}>
            <Text>&#9733;</Text>
          </Link>
        </Button>
      </FooterTab>
    </Footer>
  );
};

const styles = StyleSheet.create({
  link: {
    flex: 1,
  },
});
